-- ----------------------------
-- Table structure for account
-- ----------------------------
DROP TABLE IF EXISTS `account`;
CREATE TABLE `account` (
  `id` int(11) NOT NULL auto_increment,
  `acc_no` text,
  `user` text,
  `address` text,
  `email` text,
  `mob` text,
  `branch` text,
  `amount` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for buy
-- ----------------------------
DROP TABLE IF EXISTS `buy`;
CREATE TABLE `buy` (
  `id` int(10) NOT NULL auto_increment,
  `pname` text,
  `user` text,
  `date` text,
  `price` text,
  `p_id` int(11) default NULL,
  `rname` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for catsubcat
-- ----------------------------
DROP TABLE IF EXISTS `catsubcat`;
CREATE TABLE `catsubcat` (
  `id` int(11) NOT NULL auto_increment,
  `categorie` text NOT NULL,
  `subcategorie` text NOT NULL,
  `cat_hcode` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for ecoupon
-- ----------------------------
DROP TABLE IF EXISTS `ecoupon`;
CREATE TABLE `ecoupon` (
  `id` int(11) NOT NULL auto_increment,
  `uname` text,
  `ecoupon_no` text,
  `ecoupon_status` text,
  `cat` text,
  `subcat` text,
  `dt` text,
  `hcode` text,
  `uid` text,
  `coupon_price` text,
  `used_status` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for history
-- ----------------------------
DROP TABLE IF EXISTS `history`;
CREATE TABLE `history` (
  `id` int(11) NOT NULL auto_increment,
  `user` text,
  `cat` text,
  `subcat` text,
  `pname` text,
  `dt` text,
  `pid` int(11) default NULL,
  `type` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for issuer
-- ----------------------------
DROP TABLE IF EXISTS `issuer`;
CREATE TABLE `issuer` (
  `id` int(11) NOT NULL auto_increment,
  `username` text NOT NULL,
  `password` text NOT NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for product
-- ----------------------------
DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `id` int(11) NOT NULL auto_increment,
  `mname` text,
  `pname` text,
  `categorie` text,
  `subcategorie` text,
  `cname` text,
  `model` text,
  `color` text,
  `price` text,
  `descr` text,
  `image` longblob,
  `date` text,
  `rank` int(11) default NULL,
  `rate` int(11) default NULL,
  `pcat_hcode` text,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for reviews
-- ----------------------------
DROP TABLE IF EXISTS `reviews`;
CREATE TABLE `reviews` (
  `id` int(11) NOT NULL auto_increment,
  `pname` text,
  `review` text,
  `c_name` text,
  `dt` text,
  `pid` int(11) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

-- ----------------------------
-- Table structure for search_history
-- ----------------------------
DROP TABLE IF EXISTS `search_history`;
CREATE TABLE `search_history` (
